import React, { useState } from 'react'
import { Redirect } from 'react-router-dom'

export default function Dashboard() {
    const [redirect, setRedirect] = useState(null);

    function handleClick(e) {
        setRedirect('/'.concat(e.target.innerHTML.toLowerCase()))
    }

    if(redirect) {
        return(
            <Redirect to={redirect}/>
        )
    }

    return(
        <div>
            <h2>Dashboard boiii</h2>
            <p>I would very much like to see all the active bids that i am allowed to see</p>
            <button onClick={setRedirect('/inventory')}>Inventory</button>
            <button onClick={setRedirect('/admin')}>Admin</button>
        </div>
    )
}
